e.timezone.utc), 'commenter': 'sev-', 'type': 'User'}, {'comment_id': 1285237411, 'comment_body': 'Normally, we do not require struct members to start from `_`, though', 'comment_created': datetime.datetime(2023, 8, 6, 16, 11, 5, tzinfo=datetime.timezone.utc), 'commenter': 'sev-', 'type': 'User'}, {'comment_id': 1285238439, 'comment_body': 'Just a side note: I am not a big fan of these simple checks followed by rest of the function wrapped into a huge region that adds indentation level.

I would write it like:

```C++
if (!conf.ready())
   return;

rapidxml::xml_node<char> *node = conf.doc()->first_node("map");

if (!nodeValid(node))
   return;

/// here goest the rest
```
