758, 'comment_body': "Joysticks are handled using the keymapper code already: <https://github.com/hax0kartik/scummvm/blob/feat-CRAB/engines/crab/input/input.cpp#L97>. Imo, these functions aren't needed anymore and can be removed completely.", 'comment_created': datetime.datetime(2023, 8, 9, 3, 34, 8, tzinfo=datetime.timezone.utc), 'commenter': 'hax0kartik', 'type': 'User'}, {'comment_id': 1287893604, 'comment_body': 'Unused function, removed.', 'comment_created': datetime.datetime(2023, 8, 9, 3, 36, 3, tzinfo=datetime.timezone.utc), 'commenter': 'hax0kartik', 'type': 'User'}, {'comment_id': 1287896533, 'comment_body': 'Autosaves are already supported and are working. Dead code. Removed.', 'comment_created': datetime.datetime(2023, 8, 9, 3, 43, 18, tzinfo=datetime.timezone.utc), 'commenter': 'hax0kartik', 'type': 'User'}, {'comment_id': 1287898661, 'comment_body': 'This function is a part of the old save system,  I have left it in because there is a small chance that I might need this in future.', 'comment_created': datetime.datetime(2023, 8, 9, 3, 48, 39, tzinfo=datetime.timezone.utc), 'commenter': 'hax0kartik', 'type': 'User'}, {'comment_id': 1288407225, 'comment_body': 'There is no need to init `Common::String` with `""`, since it is in its default constructor. E.g. in this case, you may just remove this constructor, it is equivalent to the default one.', 'comment_created': datetime.datetime(2023, 8, 9, 12, 29, 8, tzinfo=datetime.timezone.utc), 'commenter': 'sev-', 'type': 'User'}, {'comment_id': 1288424181, 'comment_body': 'This is a bit weird code. Why not write it like this:

