To test: 

1, set up global or game volume in GUI. Launch the game, and check that it is correct. That should include the "mute all" button.
2. open GMM (Ctrl+F5), adjust volume settings there and see that it is reflected correctly in the game
3. Adjust the volume setting in-game open GMM, and see that it is reflected there correctly.', 'comment_created': datetime.datetime(2023, 8, 9, 15, 48, 52, tzinfo=datetime.timezone.utc), 'commenter': 'sev-', 'type': 'User'}, {'comment_id': 1288771119, 'comment_body': 'cleanup?', 'comment_created': datetime.datetime(2023, 8, 9, 15, 49, 31, tzinfo=datetime.timezone.utc), 'commenter': 'sev-', 'type': 'User'}, {'comment_id': 1288787535, 'comment_body': 'I think, the method shuld be renamed to `get()`, from `Get()`', 'comment_created': datetime.datetime(2023, 8, 9, 15, 54, 38, tzinfo=datetime.timezone.utc), 'commenter': 'sev-', 'type': 'User'}, {'comment_id': 1288792426, 'comment_body': 'formatting', 'comment_created': datetime.datetime(2023, 8, 9, 15, 55, 55, tzinfo=datetime.timezone.utc), 'commenter': 'sev-', 'type': 'User'}, {'comment_id': 1288800703, 'comment_body': 'Is the comment coming from the original or is it your unfinished experiment?', 'comment_created': datetime.datetime(2023, 8, 9, 15, 58, tzinfo=datetime.timezone.utc), 'commenter': 'sev-', 'type': 'User'}, {'comment_id': 1288807745, 'comment_body': 'cleanup?', 'comment_created': datetime.datetime(2023, 8, 9, 15, 59, 36, tzinfo=datetime.timezone.utc), 'commenter': 'sev-', 'type': 'User'}, {'comment_id': 1288814451, 'comment_body': 'Cleanup or, on the contrary, restore debug console implementation? Or move its functionality (if any) to our console?', 'comment_created': datetime.datetime(2023, 8, 9, 16, 1, 22, tzinfo=datetime.timezone.utc), 'commenter': 'sev-', 'type': 'User'}, {'comment_id': 1288819614, 'comment_body': 'What are the savefile names? Normally, it should be `target.s###` in ScummVM, so you know which target (not gameid) it is. And autosave is a separate subsystem in scummvm, those go to slot #0.', 'comment_created': datetime.datetime(2023, 8, 9, 16, 2, 41, tzinfo=datetime.timezone.utc), 'commenter': 'sev-', 'type': 'User'}, {'comment_id': 1288824989, 'comment_body': 'Kill this file?', 'comment